import React, { useState } from 'react';
import Cources from './Cources';


const Allcource=()=>{
    const [cources, setCources]=useState([
        {title:"Java Cource", description:"It is a java cource for beginers."},
        {title:"Java Cource", description:"It is a java cource for beginers."},
        {title:"Java Cource", description:"It is a java cource for beginers."}
    ]);
return(<>
<div>
    <h1> All Cources</h1>
    <p>List Of all cources</p>
    {
        cources.length > 0 ? cources.map((val,index)=> <Cources props={val} key={index} />) :  "No Cources Available" 
    }
</div>

</>);
}

export default Allcource;
